  false,\n\t\"url\": null,\n\t\"notes\": \"Euphorbia esula is a long-lived perennial
  plant with an extensive root system. The extent of the root system makes the plant
  highly resistant to most traditional weed control techniques, since remaining root
  fragments may produce shoots from more than a meter below the soil surface.  Seeds
  remain viable for at least 8 years, so any efforts at control must be long-term.
  \ The objectives of this study are (1) to assess population trends in E. esula and
  Aphthona spp. as well as native vegetation over the course of the study, and (2)
  to determine the effect of competitive plantings, nitrogen manipulation, and their
  interaction, in the presence of herbivory by Aphthona spp., on E. esula persistence,
  reproduction, and spread.  Permanent baseline transects were established in spring
  1998 on sites at Arrowwood National Wildlife Refuge and Tewaukon National Wildlife
  Refuge in the northern mixed grass prairie of North Dakota.  This report summarizes
  the data collected from these two sites between 1998 and 2002.\",\n\t\"owner_org\":
